INSERT INTO `tbl_posts` (`id`, `Title`, `slug`, `image`, `content`, `en_content`, `metaLink`, `metaTitle`, `metaKeywords`, `metaDescription`, `created_date`) VALUES
(38, 'Iphone 14 Segera Hadir, Berapa Prediksi Harganya?', 'iphone-14-segera-hadir-berapa-prediksi-harganya', 'portfolio-3.jpg', '<p>Apple akan meluncurkan seri Iphone&nbsp;terbaru dalam acara Far Out<a href=\"https://republika.co.id/tag/apple\">&nbsp;Apple&nbsp;</a>yang dijadwalkan pada 7 September mendatang. Artinya, kedatangan Iphone&nbsp;14 hanya menunggu satu pekan lagi.</p>\r\n\r\n<p>Namun, berapa biaya yang perlu disiapkan untuk membeli seri terbaru Iphone ini?&nbsp;Penerus Iphone&nbsp;13 diharapkan memiliki sejumlah fitur keren dengan kamera 48 megapiksel dan opsi Iphone&nbsp;14 Max 6,7 inci baru. Menurut prediksi dari analis Wedbush Dan Ives, kenaikan harga untuk seri Iphone&nbsp;terbaru bisa sampai 100 dolar AS atau Rp 1,4 juta.</p>\r\n\r\n<p>Ini sejalan dengan perkiraan sebelumnya yang dibagikan oleh analis dengan&nbsp;<em>The Sun</em>, menunjukkan bahwa seluruh rantai pasokan Apple mengalami kenaikan harga. Apple tidak melakukan perubahan harga antara Iphone&nbsp;12 dan Iphone&nbsp;13, tetapi kedua generasi Iphone&nbsp;itu bisa disebut cukup mirip.</p>\r\n\r\n<p>Masuk akal jika peningkatan permintaan produk sejalan dengan harga yang tinggi. Namun, Apple mungkin akan mempertahankan harga yang sama untuk tetap bersaing dengan perangkat Android seperti Samsung Galaxy S22 dan jajaran Pixel 6 Google.&nbsp;Apple biasanya merilis Iphone&nbsp;baru pada September meskipun beberapa opsi ukuran baru telah diluncurkan lebih lambat dari biasanya di tahun-tahun sebelumnya.</p>\r\n', 'Apple akan meluncurkan seri Iphone&nbsp;terbaru dalam acara Far Out&nbsp;Apple&nbsp;yang dijadwalkan pada 7 September mendatang. Artinya, kedatangan Iphone&nbsp;14 hanya menunggu satu pekan lagi.\r\n\r\nNamun, berapa biaya yang perlu disiapkan untuk membeli seri terbaru Iphone ini?&nbsp;Penerus Iphone&nbsp;13 diharapkan memiliki sejumlah fitur keren dengan kamera 48 megapiksel dan opsi Iphone&nbsp;14 Max 6,7 inci baru. Menurut prediksi dari analis Wedbush Dan Ives, kenaikan harga untuk seri Iphone&nbsp;terbaru bisa sampai 100 dolar AS atau Rp 1,4 juta.\r\n\r\nIni sejalan dengan perkiraan sebelumnya yang dibagikan oleh analis dengan&nbsp;The Sun, menunjukkan bahwa seluruh rantai pasokan Apple mengalami kenaikan harga. Apple tidak melakukan perubahan harga antara Iphone&nbsp;12 dan Iphone&nbsp;13, tetapi kedua generasi Iphone&nbsp;itu bisa disebut cukup mirip.\r\n\r\nMasuk akal jika peningkatan permintaan produk sejalan dengan harga yang tinggi. Namun, Apple mungkin akan mempertahankan harga yang sama untuk tetap bersaing dengan perangkat Android seperti Samsung Galaxy S22 dan jajaran Pixel 6 Google.&nbsp;Apple biasanya merilis Iphone&nbsp;baru pada September meskipun beberapa opsi ukuran baru telah diluncurkan lebih lambat dari biasanya di tahun-tahun sebelumnya.\r\n', '', 'Iphone 14 Segera Hadir, Berapa Prediksi Harganya?', 'Iphone 14 Segera Hadir, Berapa Prediksi Harganya?', 'Apple akan meluncurkan seri Iphone&nbsp;terbaru dalam acara Far Out&nbsp;Apple&nbsp;yang dijadwalkan pada 7 September mendatang. Artinya, kedatangan Iphone&nbsp;14 hanya menunggu satu pekan lagi.Namun, berapa biaya yang perlu disiapkan untuk membeli seri terbaru Iphone ini?&nbsp;Penerus Iphone&nbsp;13 diharapkan memiliki sejumlah fitur keren dengan kamera 48 megapiksel dan opsi Iphone&nbsp;14 Max 6,7 inci baru. Menurut prediksi dari analis Wedbush Dan Ives, kenaikan harga untuk seri Iphone&nbsp;terbaru bisa sampai 100 dolar AS atau Rp 1,4 juta.Ini sejalan dengan perkiraan sebelumnya yang dibagikan oleh analis dengan&nbsp;The Sun, menunjukkan bahwa seluruh rantai pasokan Apple mengalami kenaikan harga. Apple tidak melakukan perubahan harga antara Iphone&nbsp;12 dan Iphone&nbsp;13, tetapi kedua generasi Iphone&nbsp;itu bisa disebut cukup mirip.Masuk akal jika peningkatan permintaan produk sejalan dengan harga yang tinggi. Namun, Apple mungkin akan mempertahankan harga yang sama untuk tetap bersaing dengan perangkat Android seperti Samsung Galaxy S22 dan jajaran Pixel 6 Google.&nbsp;Apple biasanya merilis Iphone&nbsp;baru pada September meskipun beberapa opsi ukuran baru telah diluncurkan lebih lambat dari biasanya di tahun-tahun sebelumnya.', '2022-09-16 06:56:47');
