(1, 'Company Profile', '<p><span dir=\"ltr\">PT. AMANAH NUSA TENGGARA KARGO ( ANT KARGO )</span><span dir=\"ltr\"> </span><span dir=\"ltr\">BERDIRI SEJAK</span><span dir=\"ltr\"> TAHUN 2021 YANG BERGERAK DI BIDANG JASA PENGIRIMAN, SPESIALIS</span><br />\r\n<span dir=\"ltr\">UNTUK AREA JAWA, BALI, LOMBOK, SUMBAWA DAN PADA AGUSTUS 2022</span><span dir=\"ltr\"> BERUBAH NAMA MENJADI</span></p>\r\n\r\n<p><span dir=\"ltr\">PT.</span><span dir=\"ltr\"> </span><span dir=\"ltr\">ANDALAN</span><span dir=\"ltr\"> NAFAST </span><span dir=\"ltr\">TRANSPORTASI</span><span dir=\"ltr\"> </span><span dir=\"ltr\">(</span><span dir=\"ltr\">ANT</span><span dir=\"ltr\"> </span><span dir=\"ltr\">KARGO)</span><br />\r\n<span dir=\"ltr\">DENGAN MELAKUKAN PENGEMBANGAN AREA MELIPUTI SUMATERA, JAWA,</span><span dir=\"ltr\"> BALI, NTB, BATAM, KALIMANTAN DAN SULAWESI. DENGAN PENGALAMAN</span><br />\r\n<span dir=\"ltr\">SDM ( SUMBER DAYA MANUSIA ) YANG PROFESIONAL UNTUK MEMBERIKAN</span><span dir=\"ltr\"> LAYANAN TERBAIK DENGAN MENGEDEPANKAN KESELAMATAN BARANG</span><br />\r\n<span dir=\"ltr\">DIMULAI DARI PENJEMPUTAN, PEMBERANGKATAN, PENGANTARAN</span><span dir=\"ltr\"> SAMPAI TUJUAN, YANG MENGEDEPANKAN SERVICE TERBAIK DALAM</span><br />\r\n<span dir=\"ltr\">KETEPATAN WAKTU DAN KEAMANAN BARANG.</span></p>\r\n\r\n<p><span dir=\"ltr\">ANT CARGO</span><span dir=\"ltr\"> </span><span dir=\"ltr\">, SELALU BERKOMITMEN UNTUK MEMBERIKAN PELAYANAN</span><span dir=\"ltr\"> TERBAIK KEPADA PELANGGAN DENGAN MENGOPTIMALKAN SUMBER DAYA</span><br />\r\n<span dir=\"ltr\">YANG ADA, SERTA MEMBERIKAN SARANA KERJA PENDUKUNG YANG</span><span dir=\"ltr\"> TERBAIK UNTUK MEMAKSIMALKAN SERVICE DAN KEPUASAN PELANGGAN.</span></p>\r\n', 'company_ant.png'),
